import React from "react";

function Slider()  {
    const settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1
      };
      
    return (
        <div className="vertical-navbar">
        <div className="row">
          <h1>Mi perfil</h1>
          <Slider {...settings}>
            <div>
              <img src="imagen1.jpg" alt="Imagen 1" />
            </div>
            <div>
              <img src="imagen2.jpg" alt="Imagen 2" />
            </div>
            <div>
              <img src="imagen3.jpg" alt="Imagen 3" />
            </div>
          </Slider>
        </div>
      </div>
    );
};

export default Slider;
